                "id": 4910410,
                "description": "As the home of Kennedy Space Centre, Cape Canaveral is the launching point for all-out adventure in Central Florida. Its beaches offer a mix of family-friendly shores and secluded swathes of sand. And with Orlando’s theme park sprawl only an hour away, you can easily mingle with your favourite characters. Beyond the parks lie equally amusing gems packed with Old Florida character. Kayak past manatees in the Banana River Lagoon and zip line above alligators at Brevard Zoo. Discover notable art museums and Park Avenue’s ritzy charm. Orlando cruises give you access to trace the region’s roots at the Orange County Regional History Museum.",
                "orderid": 1
